import os
from langchain_community.document_loaders import TextLoader
from langchain_text_splitters import RecursiveCharacterTextSplitter
from langchain_openai import OpenAIEmbeddings
from langchain_community.vectorstores import Chroma
from langchain_openai import ChatOpenAI
from langchain.chains import create_retrieval_chain
from dotenv import load_dotenv
from langchain_community.vectorstores import FAISS
from langchain_core.prompts import ChatPromptTemplate
from langchain.chains.combine_documents import create_stuff_documents_chain
from langchain_core.messages import HumanMessage, SystemMessage
#from PIL import Image
import io

load_dotenv()
# OpenAI API 키 설정
api_key = os.getenv("OPENAI_API_KEY")

# 문서 로드 함수
def load_rewardPolicy():
    loader = TextLoader('rewardPolicy.txt')
    print(loader)
    documents = loader.load()
    
    text_splitter = RecursiveCharacterTextSplitter(
        chunk_size=1000,
        chunk_overlap=200
    )
    splits = text_splitter.split_documents(documents)
    
    return splits


# 문서 로드 함수
def load_largewastePolicy():
    loader = TextLoader('largewastePolicy.txt')
    print(loader)
    documents = loader.load()
    
    text_splitter = RecursiveCharacterTextSplitter(
        chunk_size=1000,
        chunk_overlap=200
    )
    splits = text_splitter.split_documents(documents)
    
    return splits


# 벡터 스토어 생성 함수
def create_vectorstore(splits):
    embeddings = OpenAIEmbeddings(model="text-embedding-3-large")
    vectorstore = Chroma.from_documents(documents=splits, embedding=embeddings)
    return vectorstore


# RetrievalQA 체인 생성 함수
def processing_user_input(vectorstore):
    llm = ChatOpenAI(model_name="gpt-4o", temperature=1, openai_api_key=api_key)

    prompt = ChatPromptTemplate.from_template(
    """아래의 문맥을 사용하여 질문에 답하십시오.
    정보가 없는 질문이 나오면 대답을 거절하세요.
    
    당신은 서울시의 재활용 지원 정책에 대한 정보를 제공하는 챗봇입니다. 
    친절하고 정중한 어조로 대답하세요. 한국어로 대답하세요. 당신의 이름은 'Green Seoul Bot' 입니다. 
    '행정구역' 열에서 해당 지역을 찾아 맞는 정보만 정확하게 읽으세요. 

    번호 단위로 줄바꿈을 하십시오.
    인삿말을 빼고 1번부터 시작하십시오.

    각 지역에 필요한 정보는 여러 행에 존재합니다. 
    먼저 지역을 찾아 연속 5개의 행을 읽어 '행정구역'에서 요청한 지역과 일치하는 정보만 검색합니다.
    답변 작성 시 “**”, “##” 등의 기호를 삭제하세요. 한 항목을 작성한 후 줄바꿈을 시행하세요. 

    base64 파일이 들어오면 해당 이미지 안에 있는 물체의 정보만 제공해줘

    마지막에 답변 요약해서 3문장으로 알려줘
    Context: {context}
    Question: {input}
    Answer:""")

    documents = load_rewardPolicy() 
    embeddings = OpenAIEmbeddings()
    vector = FAISS.from_documents(documents, embeddings)
    retriever = vector.as_retriever()
    document_chain = create_stuff_documents_chain(llm, prompt)
    qa_chain = create_retrieval_chain(retriever, document_chain)

    print('qa chai: ',qa_chain)

    return qa_chain


# RetrievalQA 체인 생성 함수
def processing_image():

    vision_model = ChatOpenAI(
    model="gpt-4o", temperature=0.1, max_tokens=4096
)

    system_message = SystemMessage(
        content=[
        """아래의 문맥을 사용하여 질문에 답하십시오. 정보가 없는 질문이 나오면 대답을 거절하세요.
        당신은 서울시의 재활용 지원 정책에 대한 정보를 제공하는 챗봇입니다. 
        친절하고 정중한 어조로 대답하세요. 한국어로 대답하세요. 당신의 이름은 'Green Seoul Bot' 입니다. 
    
        base64파일이 들어오면 해당 이미지를 분석하여 어떤 이미지인 지 판별하십시오.
        먼저 이미지에 대한 답변을 생성한 뒤
        해당 이미지를 아래에 있는 정보와 결합하여 답하십시오

        만일 아래 정보와 이미지가 맞지 않으면 이미지에 대한 설명만 답하십시오
        
        장롱은 5000원
        침대는 1000원


        """
        ]
    )
    vision_message = HumanMessage(
        content=[
            {"type": "text", "text": "해당 이미지 분석해줘"},
            {
                "type": "image_url",
                "image_url": {
                    "url": "data:image/jpeg;base64,",
                    "detail": "auto",
                },
            },
        ]
    )
    output = vision_model.invoke([system_message, vision_message])
    #print(output)

    return output.content


